package leetcode5;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class S242_ValidAnagram {
    public static void main(String[] args) {
        //Input: s = "anagram", t = "nagaram"
        String s = "";
        String t = "";
        System.out.println(isAnagram(s,t));
    }
    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> sCheckMap = new HashMap<>();
        Map<Character, Integer> tCheckMap = new HashMap<>();
        for (int i = 0 ; i < s.length(); i++) {
            char sChar = s.charAt(i);
            char tChar = t.charAt(i);
            sCheckMap.put(sChar, sCheckMap.getOrDefault(sChar,0)+1);
            tCheckMap.put(tChar, tCheckMap.getOrDefault(tChar,0)+1);
        }

        Set<Character> keySet = new HashSet<>();
        keySet.addAll(sCheckMap.keySet());

        for (char character : keySet) {
            int a = sCheckMap.getOrDefault(character, 0);
            int b = tCheckMap.getOrDefault(character, 0);
            if (a != b) {
                return false;
            }
            sCheckMap.remove(character);
            tCheckMap.remove(character);
        }
        return sCheckMap.isEmpty() && tCheckMap.isEmpty();
    }
}
